import React from 'react';
import bannerImg from './assets/banner.png';

const Banner = () => {
  return (
    <div
      style={{
        width: '1440px',
        height: '500px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        overflow: 'hidden',
        margin: '0 auto',
      }}
    >
      <img
        src={bannerImg}
        alt="Banner"
        style={{ width: '100%', height: '100%', objectFit: 'cover' }}
      />
    </div>
  );
};

export default Banner;
